<!DOCTYPE html><html><head>  <title>Datepicker</title>  <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">  <link href="css/normalize.css" rel="stylesheet" type="text/css"/>  <link href="css/datepicker.css" rel="stylesheet" type="text/css"/>  <link rel="stylesheet" href="css/style.css">  <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/css/bootstrap.min.css">  <link rel="stylesheet" type="text/css" href="//cdn.jsdelivr.net/npm/slick-carousel@1.8.1/slick/slick.css"/>  <link rel="stylesheet" type="text/css" href="//cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.9.0/slick-theme.css"/>  <script src="https://code.jquery.com/jquery-2.2.4.min.js" integrity="sha256-BbhdlvQf/xTY9gja0Dq3HiwQF8LaCRTXxZKRutelT44=" crossorigin="anonymous"></script>  <script src="https://code.jquery.com/ui/1.12.1/jquery-ui.min.js" integrity="sha256-VazP97ZCwtekAsvgPBSUwPFKdrwD3unUfSGVYrahUqU=" crossorigin="anonymous"></script>  <script type="text/javascript" src="js/javascript.js"></script>  <script type="text/javascript" src="js/datepicker-he.js"></script>  <script type="text/javascript" src="js/hebcal.min.js"></script>  <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.16.0/umd/popper.min.js"></script>  <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.0/js/bootstrap.min.js"></script>  <script type="text/javascript" src="//cdn.jsdelivr.net/npm/slick-carousel@1.8.1/slick/slick.min.js"></script></head><body data-page-id="home" class="jewish-style"><div class="page-title">  <h1>היום-יום</h1>  <h2>-דקה לנשמה-</h2></div><div id="datepicker"></div><!-- Modal --><div class="modal fade" id="videoModal" tabindex="-1" role="dialog" aria-labelledby="videoModalTitle" aria-hidden="true">  <div class="modal-dialog modal-dialog-centered" role="document">    <div class="modal-content">      <div class="modal-header">        <h5 class="modal-title" >Modal title</h5>        <button type="button" class="close" data-dismiss="modal" aria-label="Close">          <span aria-hidden="true">&times;</span>        </button>      </div>      <div class="modal-body">        <div class="videoWrapper">          <iframe class="iframeYoutube" width="870" height="600"                  src="https://www.youtube.com/embed/L6wglt9oCEA"                  frameborder="0" allowfullscreen>          </iframe>        </div>      </div>      <div class="modal-footer">        <button type="button" class="btn btn-primary" id="next-day">ליום הבא</button>        <button type="button" class="btn btn-light" id="prev-day">ליום הקודם</button>      </div>    </div>  </div></div><div class="page-bottom-title">  <h3>מאת שחר טנג'י</h3></div><!--<button id="populate_db">populate</button>--></body></html>